import React, { useState } from 'react';

// Mock token data
const tokenList = [
  {
    name: 'PAWPAW',
    emoji: 'üê∂',
    volumeSpike: 115,
    risk: 'Low',
    meta: 'GambleFi',
    roi: 24.4,
    price: '$0.123',
    cap: '$1.2M',
    strategy: 'Smart Whale + GambleFi',
    winRate: 68,
  },
  {
    name: 'BABY BOB',
    emoji: 'üê∏',
    volumeSpike: 134,
    risk: 'Low',
    meta: 'GambleFi',
    roi: 34.1,
    price: '$0.089',
    cap: '$0.8M',
    strategy: 'Volume Spike + Meme',
    winRate: 72,
  },
  {
    name: 'RUGPULL',
    emoji: 'üí©',
    volumeSpike: 210,
    risk: 'High',
    meta: 'Meme',
    roi: -12.5,
    price: '$0.002',
    cap: '$0.1M',
    strategy: 'High Risk + Meme',
    winRate: 12,
  },
];

function ProgressBar({ value }) {
  return (
    <div className="w-full h-1.5 bg-zinc-800 rounded overflow-hidden mt-1">
      <div
        className="h-full rounded bg-green-400 transition-all"
        style={{ width: `${value}%` }}
      />
    </div>
  );
}

export default function DashboardTab() {
  const [selectedToken, setSelectedToken] = useState(null);

  return (
    <div className="w-full min-h-screen bg-black text-white px-4 py-6">
      <div className="grid grid-cols-12 gap-4 items-start">
        {/* Pinged Tokens Panel */}
        <aside className="col-span-2 bg-zinc-900 rounded-xl shadow-lg p-3 flex flex-col gap-4">
          <h3 className="text-lg font-bold text-white mb-2">Pinged Tokens</h3>
          {tokenList.map((t) => (
            <div
              key={t.name}
              className={`group rounded-lg bg-zinc-800/80 px-3 py-2 flex flex-col gap-1 shadow border border-zinc-700 hover:border-blue-400 hover:shadow-xl transition cursor-pointer ${selectedToken?.name === t.name ? 'border-blue-400 ring-2 ring-blue-400/30' : ''}`}
              onClick={() => setSelectedToken(t)}
            >
              <div className="flex items-center justify-between">
                <span className="font-semibold text-base flex items-center gap-1">
                  {t.emoji} {t.name}
                  <span className={`ml-2 text-xs px-2 py-0.5 rounded ${t.risk === 'High' ? 'bg-red-500/20 text-red-400' : 'bg-green-500/20 text-green-300'}`}>{t.risk}</span>
                </span>
                <span className={`text-xs font-bold ${t.roi > 0 ? 'text-green-400' : 'text-red-400'}`}>{t.roi > 0 ? '+' : ''}{t.roi}%</span>
              </div>
              <div className="flex justify-between text-xs text-zinc-400">
                <span>Vol: {t.volumeSpike}%</span>
                <span>{t.meta}</span>
              </div>
              <ProgressBar value={t.winRate} />
              {/* Hover: show more metrics */}
              <div className="hidden group-hover:flex flex-col gap-1 mt-1 text-xs text-zinc-300">
                <span>Cap: {t.cap}</span>
                <span>Strategy: {t.strategy}</span>
                <span>Price: {t.price}</span>
              </div>
            </div>
          ))}
        </aside>

        {/* Chart + Table (center) */}
        <main className="col-span-6">
          {/* TODO: Step 3 - Chart + Strategy Bar + Table */}
        </main>

        {/* Trading Terminal (right) */}
        <aside className="col-span-4">
          {/* TODO: Step 4 - Trading Terminal */}
        </aside>
      </div>
    </div>
  );
}
